import {Container } from "react-bootstrap";
import React from "react";
import styled from "styled-components";
import AboutMe from "./AboutMe";



function EditProfile() {
  return (
    <Container.fluid>
      <ProfileDetails />
      <AboutMe />
    </Container.fluid>
  );
}

export default EditProfile;
